import React from 'react'

const SearchBar = () => {
    return (
        <div className="search-bar-container">
            <Grid>
                <Grid.Column width={6}>
                    <Search
                    loading={loading}
                    onResultSelect={(e, data) =>
                        dispatch({ type: 'UPDATE_SELECTION', selection: data.result.title })
                    }
                    onSearchChange={handleSearchChange}
                    results={results}
                    value={value}
                    />
                </Grid.Column>
            </Grid>
        </div>
    )
}

export default SearchBar
